import React, { Component } from "react";

class Test extends Component {
  constructor(props) {
    super(props);
    this.state = {
      itesm: [],
      isLoaded: false,
    }
    this.retrieveProperties = this.retrieveProperties.bind(this);
  }

  componentDidMount() {
    fetch('http://45.77.232.166:8080/')
      .then(res => res.json())
      .then(json => {
        this.setState({
          isLoaded:true,
          items: json,
        })
      });
  }

  retrieveProperties(obj) {
    const res = [];
    for(obj.key in obj){
       res.push([ obj.key, obj[obj.key] ]);
    };
    alert(res);
    return res;
  };
  
  render() {

    var{ isLoaded, items} = this.state;
    if(!isLoaded) {
      return <div>Loading...</div>
    }
    else {
      return(
        <div className ="Test">
            Data loaded
            <ul>
              {console.log(this.retrieveProperties(items))}
            </ul>
        </div>
      );
    }
    
  }

};

export default Test;
